import { jsPDF } from "jspdf";
import getDecimalNumber from "./getDecimalNumber";
import QRCode from "qrcode";
import moment from "moment";
export const generateInvoice = async ({
  print_settings,
  settings,
  order,
  online = false,
  phone = false,
  isDispatched = false,
}) => {
  let width = 80;
  let height = 297;
  const GAP = 6;
  const RLE = "\u202B"; // Right-to-Left Embedding
  const PDF = "\u202C"; // Pop Directional Formatting (to end the RTL context)
  const doc = new jsPDF({
    unit: "mm",
    format: [width, height], // Dynamic width, fixed height (A4 length)
    filters: ["ASCIIHexEncode"],
  });
  const LEFT = 8;
  const RIGHT = width - LEFT;
  // Helper function to calculate center positions
  const centerX = (elementWidth) => (width - elementWidth) / 2;

  // Add Logo
  const logoUrl =
    settings?.pos_settings?.logo_url || "/binary/JakaLogo-NoBG.png"; // Local logo link
  const addLogo = async () => {
    const response = await fetch(logoUrl);
    const blob = await response.blob();
    const reader = new FileReader();
    return new Promise((resolve) => {
      reader.onload = () => resolve(reader.result.split(",")[1]);
      reader.readAsDataURL(blob);
    });
  };
  // const loadFontFile = async () => {
  //   const response = await fetch("/fonts/NotoSansArabic.ttf"); // Adjust the path
  //   const fontBlob = await response.blob();
  //   const reader = new FileReader();

  //   return new Promise((resolve) => {
  //     reader.onload = () => resolve(reader.result.split(",")[1]); // Get base64 data
  //     reader.readAsDataURL(fontBlob);
  //   });
  // };
  const logoBase64 = await addLogo();
  doc.addImage(logoBase64, "PNG", centerX(30), LEFT, 30, 15); // Logo centered horizontally
  // const arabicfont = await loadFontFile();
  // doc.addFileToVFS("customfont.ttf", arabicfont); // font name and extension must match
  // doc.addFont("customfont.ttf", "customfont", "normal"); // register the font with jspdf

  doc.addFileToVFS("Amiri-Regular.ttf", AmiriRegular);
  doc.addFont("Amiri-Regular.ttf", "Amiri", "normal");
  let y = 30; // Starting vertical position

  doc.setFont("Amiri");
  if (print_settings?.company_name && settings?.merchant?.name != "nan") {
    doc.setFont("Amiri");
    doc.setFontSize(print_settings?.company_name_font_size || 14);
    doc.text(settings?.merchant?.name, width / 2, y, { align: "center" });
  }
  if (
    print_settings?.address_name &&
    settings?.location?.address &&
    settings?.location?.address != "nan"
  ) {
    y += GAP; // Line spacing
    doc.setFont("Amiri");
    doc.setFontSize(print_settings?.address_name_font_size || 10);
    doc.text(settings?.location?.address, width / 2, y, {
      align: "center",
    });
  }
  if (
    print_settings?.location_name &&
    print_settings?.city_name &&
    settings?.location?.city &&
    settings?.location?.region &&
    settings?.location?.city != "nan" &&
    settings?.location?.region != "nan"
  ) {
    y += GAP; // Line spacing
    doc.setFont("Amiri");
    doc.setFontSize(print_settings?.location_name_font_size || 10);
    doc.text(
      `${settings?.location?.city},${settings?.location?.region}`,
      width / 2,
      y,
      {
        align: "center",
      }
    );
  }
  if (
    settings?.merchant?.trn &&
    settings?.merchant?.trn != "nan" &&
    settings?.print_settings?.TRN
  ) {
    y += GAP; // Line spacing
    doc.setFont("Amiri");
    doc.setFontSize(settings?.print_settings?.TRN_font_size || 10);
    doc.text(`VAT No: ${settings?.merchant?.trn} : رقم الضريبي`, width / 2, y, {
      align: "center",
    });
  }
  // Separator
  y += 2; // Adjusted spacing before separator
  doc.setDrawColor(0);
  doc.line(LEFT, y, RIGHT, y);
  // y += GAP;
  // Store Name
  if (print_settings?.invoice_type) {
    y += GAP; // Adjusted vertical position
    doc.setFont("Amiri");
    doc.setFontSize(print_settings?.invoice_type_font_size || 12);
    doc.text(
      isDispatched
        ? `DELIVERY SLIP/إيصال التسليم`
        : `${order?.invoice_printed ? "XXXX" : ""} ${
            online ? "(Online)" : phone ? "(Phone)" : ""
          } ${
            order?.invoice_printed
              ? "Invoice Copy/فاتورة مكرر"
              : "Invoice/فاتورة"
          } ${order?.invoice_printed ? "XXXX" : ""}`,
      width / 2,
      y,
      { align: "center" }
    );
    y += 2; // Adjusted spacing before separator
    doc.setDrawColor(0);
    doc.line(LEFT, y, RIGHT, y);
  }
  if (
    print_settings?.header_message &&
    print_settings.header_message_text &&
    print_settings.header_message_text != "" &&
    print_settings.header_message_text != "nan"
  ) {
    // Separator
    y += GAP;
    doc.setFontSize(print_settings?.header_message_font_size || 10);
    doc.line(LEFT, y, RIGHT, y);
    // Header Message
    doc.setFont("Amiri");
    doc.text(print_settings.header_message_text, width / 2, y, {
      align: "center",
    });
    // Separator
    y += 2;
    doc.line(LEFT, y, RIGHT, y);
  }

  // Token and Details

  y += GAP;
  if (order?.token_counter && print_settings?.token_num) {
    doc.setFont("Amiri");
    doc.setFontSize(print_settings?.token_num_font_size || 10);
    doc.text(`Token الطلب: ${order?.token_counter}`, LEFT, y);
    y += GAP;
  }
  if (
    ((!online && order?.invoice_num) || (online && order?.unique_id)) &&
    print_settings?.invoice_num
  ) {
    doc.setFont("Amiri");
    doc.setFontSize(print_settings?.invoice_num_font_size || 10);

    doc.text(
      `Invoice ${RLE}الفاتورة:${PDF} ${
        online ? order?.unique_id : order.invoice_num
      } `,
      LEFT,
      y
    );
    y += GAP;
  }
  if (order?.time && print_settings?.time) {
    doc.setFontSize(print_settings?.time_font_size || 10);
    const text = `Time ${RLE}الوقت: ${PDF}${moment(order.time).format(
      "DD/MM/YYYY  h:mm a"
    )}`;
    doc.text(text, LEFT, y);
    y += GAP;
  }
  if (
    order?.order_source &&
    order?.order_source != "nan" &&
    print_settings?.order_source
  ) {
    doc.setFontSize(print_settings?.order_source_font_size || 10);
    doc.text(`Source ${RLE}الوقت:${PDF} ${order?.order_source}`, LEFT, y);
    y += GAP;
  }
  if (
    order?.order_type &&
    order?.order_type != "nan" &&
    print_settings?.order_type &&
    print_settings?.order_type != "nan"
  ) {
    doc.setFontSize(print_settings?.order_type_font_size || 10);
    doc.text(`Order Type ${RLE}فئة:${PDF} ${order?.order_type}`, LEFT, y);
    y += GAP;
  }
  if (print_settings?.cashier && order?.user?.name) {
    doc.setFontSize(print_settings?.cashier_font_size || 10);
    doc.text(`Cashier ${RLE}الموظف:${PDF} ${order?.user?.name}`, LEFT, y);
    y += GAP;
  }
  if (order?.note) {
    doc.setFontSize(print_settings?.cashier_font_size || 10);
    doc.text(`Note : ${order?.note}`, LEFT, y);
    y += GAP;
  }
  if (order?.customer && print_settings?.customer_details) {
    doc.setFontSize(print_settings?.customer_details_font_size || 10);
    if (order?.customer?.name) {
      doc.text(
        `Customer ${RLE}العميل:${PDF} ${order?.customer?.name}`,
        LEFT,
        y
      );
      y += GAP;
    }
    if (order?.customer?.phone) {
      doc.text(`Phone ${RLE}هاتف:${PDF} ${order?.customer?.phone}`, LEFT, y);
      y += GAP;
    }
    if (order?.customer?.address) {
      doc.text(
        `Address ${RLE}عنوان:${PDF} ${order?.customer?.address}`,
        LEFT,
        y
      );
      y += GAP;
    }
    if (order?.customer?.tax_reg_num) {
      doc.text(
        `Tax Num ${RLE}رقم ضريبة:${PDF} ${order?.customer?.tax_reg_num}`,
        LEFT,
        y
      );
      // Separator before Items
      y += GAP;
    }
  }
  doc.line(LEFT, y, RIGHT, y);

  // Items Table
  y += 3; // Adjusted spacing before items
  const items = [
    { name: "Item", price: "Price", qty: "Qty", total: "Total" },
    { name: "المنتج", price: "سعر", qty: "كمية", total: "اجمالي" },
  ];

  order.cartState.orderitems.map((item) => {
    const obj = {
      name: item.name,
      price: item?.selling_price ? item?.selling_price : item?.price,
      qty: item?.quantity,
      total: item?.totalPrice,
      arabic_name: item?.arabic_name || null,
      modifier_note: item?.modifier_note || [],
      note: item?.note || null,
    };
    items.push(obj);
  });
  doc.setFontSize(print_settings?.cart_item_font_size || 8);
  doc.setFont("Amiri");
  items.forEach((item, index) => {
    doc.text(item.name, LEFT, y);
    if (index <= 1) {
      doc.text(`${item.price}`, width - (LEFT + 18), y, {
        align: "right",
      });
      doc.text(item.qty.toString(), width - (LEFT + 11), y, {
        align: "right",
      });
      doc.text(`${item.total}`, RIGHT, y, { align: "right" });
    } else {
      doc.text(`${getDecimalNumber(item.price)}`, width - (LEFT + 18), y, {
        align: "right",
      });
      doc.text(item.qty.toString(), width - (LEFT + 11), y, {
        align: "right",
      });
      doc.text(`${getDecimalNumber(item.total)}`, RIGHT, y, { align: "right" });
    }
    if (item?.arabic_name) {
      y += 3;
      doc.text(item.arabic_name, LEFT, y);
    }
    if (item?.note) {
      y += 3;
      doc.setFontSize(print_settings?.item_modifier_font_size || 7);
      doc.text(`Note: ${item.note}`, LEFT + 1, y);
    }
    if (item?.modifier_note?.length) {
      doc.setFontSize(print_settings?.item_modifier_font_size || 7);
      item?.modifier_note.map((note) => {
        y += 3;
        doc.text(note, LEFT + 1, y);
      });
    }
    if (index === 1) {
      y += 3;
      doc.line(LEFT, y, RIGHT, y);
      y += 3;
    } else if (index == items.length - 1) {
      doc.setDrawColor(0);
      y += 3;
      doc.line(LEFT, y, RIGHT, y);
      y += GAP;
    } else if (index == 0) {
      y += 3;
    } else {
      y += GAP;
    }
  });

  doc.setFont("Amiri");
  // doc.setFont("helvetica");
  doc.setFontSize(print_settings?.tax_discount_font_size || 9);
  doc.text("Total Taxable الاجمالي للضريبة:", LEFT, y, { align: "left" });
  doc.text(`${order?.cartState?.totalAmount || 0.0}`, RIGHT, y, {
    align: "right",
  });
  y += GAP;
  doc.text("VAT Total إجمالي الضريبة:", LEFT, y, { align: "left" });
  doc.text(`${order?.cartState?.tax || 0.0}`, RIGHT, y, {
    align: "right",
  });
  y += GAP;
  doc.text("Total Discount إجمالي الخصم:", LEFT, y, { align: "left" });
  doc.text(`${order?.cartState?.discount || 0.0}`, RIGHT, y, {
    align: "right",
  });
  y += 2;
  doc.line(LEFT, y, RIGHT, y);
  // Total
  y += GAP;

  doc.setFontSize(print_settings?.total_payable_font_size || 9);
  doc.text("Total Due إجمالي المستحق:", LEFT, y, { align: "left" });
  doc.text(`${order?.cartState?.totalPayableAmount}`, RIGHT, y, {
    align: "right",
  });
  y += GAP;

  doc.setFontSize(print_settings?.payment_method_font_size || 9);
  doc.text("Payment Method:", LEFT, y, { align: "left" });
  doc.text(`${order?.paymentMethod}`, RIGHT, y, {
    align: "right",
  });
  if (order?.paymentMethod && order.paymentMethod.toUpperCase() == "CASH") {
    y += GAP;
    if (!online && print_settings?.cash_balance) {
      doc.setFontSize(print_settings?.cash_balance_font_size || 9);
      doc.text("Tendered Cash:", LEFT, y, { align: "left" });
      doc.text(`${order?.cartState?.amountTendered}`, RIGHT, y, {
        align: "right",
      });
      y += GAP;
      doc.text("Balance Cash:", LEFT, y, { align: "left" });
      doc.text(`${order?.cartState?.amountToBeReturned}`, RIGHT, y, {
        align: "right",
      });
      y += GAP;
    }
  }

  // Separator before Footer
  y += GAP;
  doc.line(LEFT, y, RIGHT, y);
  if (
    print_settings?.footer_message &&
    print_settings?.footer_message != "na"
  ) {
    y += GAP;
    doc.setFontSize(print_settings?.footer_message_font_size, 10);
    doc.text(print_settings?.footer_message, width / 2, y, {
      align: "center",
    });
  }
  const options = {
    qrDetails: {
      name: settings?.merchant?.name || null,
      vat: settings?.merchant?.trn ? settings?.merchant?.trn.toString() : "",
      date: order?.time ? new Date(order.time).toISOString() : null,
      tax:
        getDecimalNumber(
          order?.cartState?.tax,
          settings?.pos_settings?.currency_decimals || 2
        ) || null,
      amount:
        getDecimalNumber(
          order?.cartState?.totalPayableAmount,
          settings?.pos_settings?.currency_decimals || 2
        ) || null,
    },
  };
  // Generate QR Code
  const qrCodeData = await QRCode.toDataURL(
    await generateQRCode(options, settings)
  );
  y += 10;
  doc.addImage(qrCodeData, "PNG", centerX(30), y, 30, 30); // Center QR Code
  y += 20;
  doc.save(`POS_Invoice_${order?.invoice_num || order?.ptid}.pdf`);
};
function getTLVForValue(tagNum, tagValue) {
  return new Promise((resolve, reject) => {
    try {
      // Convert the tag number and value into Uint8Arrays
      let tagBuf = new Uint8Array([tagNum]);
      let tagValueLenBuf = new Uint8Array([tagValue.length]);
      let tagValueBuf = new TextEncoder().encode(tagValue);

      // Combine the buffers into a single Uint8Array
      let totalLength =
        tagBuf.length + tagValueLenBuf.length + tagValueBuf.length;
      let resultBuf = new Uint8Array(totalLength);

      resultBuf.set(tagBuf, 0);
      resultBuf.set(tagValueLenBuf, tagBuf.length);
      resultBuf.set(tagValueBuf, tagBuf.length + tagValueLenBuf.length);

      resolve(resultBuf);
    } catch (error) {
      reject(error); // Handle errors in buffer creation
    }
  });
}

const rtlArabicText = (text) => {
  const RLE = "\u202B"; // Right-to-Left Embedding
  const PDF = "\u202C"; // Pop Directional Formatting (to end the RTL context)
  return `${RLE}${text}${PDF}`;
};
const generateQRCode = async (options, settings) => {
  if (
    options?.qrDetails &&
    options?.qrDetails?.name &&
    options?.qrDetails?.date &&
    options?.qrDetails?.amount &&
    options?.qrDetails?.tax
  ) {
    // Generate TLV arrays for QR code data
    const name = await getTLVForValue("1", options.qrDetails.name);
    const vatNo = await getTLVForValue(
      "2",
      options.qrDetails.vat || Math.floor(Math.random() * 9e14) + 1e14
    );
    const date = await getTLVForValue("3", options.qrDetails.date);
    const amount = await getTLVForValue("4", options.qrDetails.amount);
    const tax = await getTLVForValue("5", options.qrDetails.tax);

    // Combine TLV arrays into a single QR code array
    const tagsBufsArray = [name, vatNo, date, amount, tax];
    const qrCodeBuf = concatUint8Arrays(tagsBufsArray);

    // Convert QR code buffer to base64 string for printing
    const qrCodeB64 = await toBase64(qrCodeBuf);

    // Append QR code data to the print data array
    return qrCodeB64;
  }
};
function concatUint8Arrays(arrays) {
  // Calculate the total length
  const totalLength = arrays.reduce((sum, arr) => sum + arr.length, 0);
  // Create a new Uint8Array to hold the combined data
  const result = new Uint8Array(totalLength);
  // Copy each array into the result
  let offset = 0;
  for (const arr of arrays) {
    result.set(arr, offset);
    offset += arr.length;
  }
  return result;
}
function toBase64(uint8Array) {
  const blob = new Blob([uint8Array]);
  return new Promise((resolve, reject) => {
    const reader = new FileReader();
    reader.onloadend = () => resolve(reader.result.split(",")[1]); // Extract base64 string
    reader.onerror = reject;
    reader.readAsDataURL(blob); // Read as data URL
  });
}
